import React from "react";
import { COLORS } from "../../constants";
const Footer = () => {
  return (
    <React.Fragment>
      <div
        className="block py-4 px-4"
        css={css`
          background-color: ${COLORS.BGBGRAY};
        `}
      >
        Footer Component
      </div>
    </React.Fragment>
  );
};

export default Footer;
